import * as React from 'react';
import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

const Employee = (emp) => {
    return (
            <Box component="form"
            sx={{
              '& .MuiTextField-root': { m: 1, width: '25ch' },
            }}>
               <TextField
                    required
                    id="outlined-required"
                    label="Required"
                    value={emp.firstName} /> 
            </Box>
    );
}

export default Employee
